const AppRouter = () => {
  return (
  
    <Routes>
      <Route index element={<Content />} />
      <Route exact path="/content" element={<Content />} />
      <Route  path="/login" element={<Login />} />
      <Route  path="/signup" element={<Signup />} />
    </Routes>
  
  );
};

export default AppRouter;
